import React from 'react';
import PropTypes from 'prop-types';

const propTypes = {};

const defaultProps = {};

/**
 * 
 */

const styles = {
    backgroundColor: "black",
    padding: "2px",
    color: "#979494"
}
const NavBar = () => {
    return <nav style={styles}>

        <h2>NavBar here</h2>
        <h4>Home</h4>
        <h4>About</h4>
        <h4>Projects</h4>
        <h4>Contacts</h4>
        <h4>Resume</h4>

    </nav>;
}

NavBar.propTypes = propTypes;
NavBar.defaultProps = defaultProps;
// #endregion

export default NavBar;
